function alphabet(){
	var el = this;//console.log(el);
	for(var i=65; i<91; i++){
		var letter = String.fromCharCode(i),
				op = document.createElement('option');
		op.setAttribute('value', letter);
		op.innerHTML = letter;
		el.append(op);
	}
	return true;
};
